import React, { useState } from 'react';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TableSortLabel,
  Paper,
  TablePagination,
  Collapse,
  IconButton,
  Box,
  Avatar,
  Typography
} from '@mui/material';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import KeyboardArrowUpIcon from '@mui/icons-material/KeyboardArrowUp';
import { getColumns } from './columns';
import { trackUserInteraction } from '../../utils/analytics';
import ExpandedRow from './ExpandedRow';
import { TrendingUp as TrendingUpIcon, TrendingDown as TrendingDownIcon } from '@mui/icons-material';
import { useTheme } from '@mui/material/styles';

const Row = ({ pair, columns }) => {
  const [open, setOpen] = useState(false);
  const theme = useTheme();

  const handleRowClick = () => {
    setOpen(!open);
    trackUserInteraction.pairClick(pair.pairName);
  };

  return (
    <>
      <TableRow
        hover
        sx={{
          cursor: 'pointer',
          transition: 'all 0.2s',
          '& > td': {
            p: 2,
            border: 0,
            bgcolor: pair.is_blacklisted ? 'error.lighter' : 'background.paper',
            '&:first-of-type': {
              borderTopLeftRadius: 2,
              borderBottomLeftRadius: open ? 0 : 2,
            },
            '&:last-of-type': {
              borderTopRightRadius: 2,
              borderBottomRightRadius: open ? 0 : 2,
            }
          },
          '&:hover': {
            '& > td': {
              bgcolor: pair.is_blacklisted ? 'error.light' : 'background.default',
            },
            transform: 'translateY(-2px)',
            boxShadow: 1,
            '& .expand-icon': {
              color: 'primary.main',
              transform: open ? 'rotate(-180deg)' : 'rotate(0)',
            }
          },
          mb: 1,
        }}
        onClick={handleRowClick}
      >
        <TableCell>
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
            <IconButton
              size="small"
              className="expand-icon"
              sx={{
                transition: 'all 0.2s',
                transform: open ? 'rotate(-180deg)' : 'rotate(0)',
                color: open ? 'primary.main' : 'text.secondary',
              }}
            >
              <KeyboardArrowDownIcon />
            </IconButton>
            <Avatar 
              src={pair.logoURI} 
              alt={pair.symbol}
              sx={{ width: 24, height: 24 }}
            />
            <Box>
              <Typography variant="subtitle2" sx={{ fontWeight: 600 }}>
                {pair.symbol}
              </Typography>
              <Typography variant="caption" color="text.secondary">
                {pair.name}
              </Typography>
            </Box>
          </Box>
        </TableCell>
        {columns.slice(1).map((column) => (
          <TableCell
            key={column.id}
            align={column.numeric ? 'right' : 'left'}
          >
            {column.id === 'priceChange' ? (
              <Box
                sx={{
                  display: 'inline-flex',
                  alignItems: 'center',
                  gap: 0.5,
                  px: 1,
                  py: 0.5,
                  borderRadius: 1,
                  bgcolor: (pair[column.id] || 0) >= 0 ? 'success.lighter' : 'error.lighter',
                  color: (pair[column.id] || 0) >= 0 ? 'success.main' : 'error.main'
                }}
              >
                {(pair[column.id] || 0) >= 0 ? 
                  <TrendingUpIcon fontSize="small" /> : 
                  <TrendingDownIcon fontSize="small" />
                }
                <Typography variant="caption" sx={{ fontWeight: 600 }}>
                  {(pair[column.id] || 0) >= 0 ? '+' : ''}{(pair[column.id] || 0)?.toFixed(2)}%
                </Typography>
              </Box>
            ) : (
              <Box sx={{ textAlign: column.numeric ? 'right' : 'left' }}>
                <Typography 
                  variant="body2" 
                  sx={{ 
                    fontWeight: column.highlight ? 600 : 400,
                    color: column.highlight ? 'primary.main' : 'text.primary'
                  }}
                >
                  {column.render ? column.render(pair) : pair[column.id]}
                </Typography>
                {column.subtitle && (
                  <Typography variant="caption" color="text.secondary">
                    {column.subtitle}
                  </Typography>
                )}
              </Box>
            )}
          </TableCell>
        ))}
      </TableRow>
      <TableRow>
        <TableCell
          colSpan={columns.length + 1}
          sx={{
            p: 0,
            border: 0,
            bgcolor: 'background.default',
            borderBottomLeftRadius: open ? 2 : 0,
            borderBottomRightRadius: open ? 2 : 0,
          }}
        >
          <Collapse in={open} timeout="auto" unmountOnExit>
            <Box sx={{ p: 3 }}>
              <ExpandedRow pair={pair} />
            </Box>
          </Collapse>
        </TableCell>
      </TableRow>
    </>
  );
};

const PairsTable = ({
  pairs,
  orderBy,
  order,
  page,
  rowsPerPage,
  handleSort,
  handleChangePage,
  handleChangeRowsPerPage,
  totalCount
}) => {
  const columns = getColumns();

  return (
    <TableContainer
      component={Paper}
      sx={{
        boxShadow: 2,
        borderRadius: 3,
        bgcolor: 'background.default',
        p: 2,
        '& .MuiTable-root': {
          borderCollapse: 'separate',
          borderSpacing: '0 8px'
        }
      }}
    >
      <Table aria-label="pairs table">
        <TableHead>
          <TableRow
            sx={{
              '& th': {
                border: 0,
                p: 2,
                color: 'text.secondary',
                fontWeight: 600,
                fontSize: '0.75rem',
                textTransform: 'uppercase',
                letterSpacing: '0.05em',
                bgcolor: 'transparent'
              }
            }}
          >
            {columns.map((column) => (
              <TableCell
                key={column.id}
                align={column.numeric ? 'right' : 'left'}
                sortDirection={orderBy === column.id ? order : false}
                sx={{
                  cursor: 'pointer',
                  '&:hover': {
                    color: 'primary.main'
                  }
                }}
                onClick={() => handleSort(column.id)}
              >
                <TableSortLabel
                  active={orderBy === column.id}
                  direction={orderBy === column.id ? order : 'asc'}
                  sx={{
                    '& .MuiTableSortLabel-icon': {
                      opacity: 0.5
                    }
                  }}
                >
                  {column.label}
                </TableSortLabel>
              </TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {pairs.map((pair) => (
            <Row
              key={pair.address}
              pair={pair}
              columns={columns}
            />
          ))}
        </TableBody>
      </Table>
      <TablePagination
        rowsPerPageOptions={[10, 25, 50, 100]}
        component="div"
        count={totalCount}
        rowsPerPage={rowsPerPage}
        page={page}
        onPageChange={handleChangePage}
        onRowsPerPageChange={handleChangeRowsPerPage}
        sx={{
          mt: 2,
          borderTop: 1,
          borderColor: 'divider',
          '& .MuiTablePagination-select': {
            bgcolor: 'background.paper',
            borderRadius: 1,
            p: 1
          }
        }}
      />
    </TableContainer>
  );
};

export default PairsTable;
